<!DOCTYPE html>
<html lang="da">

<head>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Forside</title>
    <link rel="stylesheet" href="style.css">
</head>

<body>
    <header class="sideheader">

        <div id="keatitle">
            <img id="keaimg" src="img/headertitle.svg" alt="title">
            <img id="profile" src="img/profileicon.svg" alt="profile">
            <img id="burgericon" src="img/burgericon.svg" alt="burger">
        </div>

    </header>

    <section id="forside">
        <div class="col1">
            <div class="box"></div>
            <div class="box"></div>
            <div class="box"></div>
        </div>
        <div class="col2">
            <div class="box2"></div>
            <div class="box"></div>
        </div>
        <div class="col3">
            <div class="box"></div>
            <div class="box"></div>
            <div class="box"></div>
        </div>
        <div class="col4">
            <div class="boxwrapper">
                <div class="box"></div>
                <div class="box"></div>
            </div>
            <div class="box3"></div>
        </div>
        <div class="col5">
            <div class="box"></div>
            <div class="box"></div>
            <div class="box"></div>
        </div>
    </section>



    <script src=""></script>
</body>

</html>
